import React from 'react';

const BtnBlanco = () => {
    return <div>
        <div className='containerbtnNuevo'>
            <button className='btnNuevo'><i className="fas fa-user-tie"></i>Usuarios</button>
        </div>
    </div>;
};

export default BtnBlanco;
